import { Button, Col, Input, Row } from 'antd'
import React from 'react'
import TodoList from './components/TodoList'
function TodoFeature(props) {
    const todoList = [
        {
            id: 1,
            title: 'do something1'
        },
        {
            id: 2,
            title: 'do something2'
        },
        {
            id: 3,
            title: 'do something3'
        },
        {
            id: 4,
            title: 'do something4'
        },
        {
            id: 5,
            title: 'do something5'
        },
        {
            id: 6,
            title: 'do something6'
        },
    ]

  return (
    <div>
        <h3>Todo List</h3>
        <Row gutter={16}>
            <Col span={18} order={1}>
                <TodoList todoList={todoList}/>
            </Col>
            <Col span={6} order={2}>
                <Row>
                    <Col span={24}>
                        <Input.Group>
                            <Input style={{width: 'calc(100% - 200px)'}} placeholder="Type to add todo ..."/>
                            <Button/>
                        </Input.Group>
                    </Col>
                    
                </Row>
            </Col>
        </Row>
    </div>
  )
}


export default TodoFeature
